import Login from "./pages/Login";
import {  BrowserRouter, Route} from "react-router-dom";


function App() {
  return (
     <BrowserRouter>

      <Route  path="/" to={null} />
      <Route  path="/login" to={Login} />
      <Route  path="/signup" to={null} />

     </BrowserRouter>

  );
}

export default App;
